tables.table_schema:
CREATE TABLE user_engagement_data (
    id INT PRIMARY KEY,
    user_id INT,
    engagement_score FLOAT,
    activity_date DATE
);

CREATE TABLE Users (
    user_id UUID PRIMARY KEY,
    user_name VARCHAR(50),
    country VARCHAR(50),
    age INTEGER
);

CREATE TABLE user_engagement_data (
    user_id INT PRIMARY KEY,
    engagement_score FLOAT,
    country_code VARCHAR(2),
    timestamp TIMESTAMP
);

CREATE TABLE behavior_data (
    user_id INT PRIMARY KEY,
    behavior_type VARCHAR(50),
    behavior_description TEXT,
    behavior_timestamp TIMESTAMP
);

CREATE TABLE campaign_engagement_metrics (
    campaign_id INT,
    user_id INT,
    engagement_level VARCHAR(20)
);
